import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';

import './sidebar.css';


const Sidebar = () => {
    return (
        <Navbar className="sidebar" bg="light" expand="lg">
            <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav.Item>
                    <NavLink className="nav-link" to={'about'}>About</NavLink>
                    <NavLink className="nav-link" to={'experience'}>Experience</NavLink>
                    <NavLink className="nav-link" to={'education'}>Education</NavLink>
                    <NavLink className="nav-link" to={'skills'}>Skills</NavLink>
                    <NavLink className="nav-link" to={'interests'}>Interests</NavLink>
                </Nav.Item>
            </Navbar.Collapse>
        </Navbar>
    );
}

export default Sidebar;
